import React from "react";
import { Route, Routes } from "react-router-dom";
import AdminLogin from "./Component/AdminLogin"; // スペルを確認して修正
import AdminDashboard from "./Component/AdminDashboard"; // スペルを確認して修正
import NotFound from "./Component/NotFound"; // 404ページを追加する場合

function App() {
  return (
    <Routes>
      <Route path="/login" element={<AdminLogin />} />
      <Route path="/" element={<AdminDashboard />} />
      {/* 404ページのためのルート */}
      <Route path="*" element={<NotFound />} />
    </Routes>
  );
}

export default App;
